// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;

//Contract Moneylock
contract MoneyLock {
    // Address of the party that holds the security deposit
    address payable depositHolder;
    // Address of the other party
    address payable otherParty;
    // Security deposit amount
    uint256 public securityDeposit;
    // End date of the agreement
    uint256 public endDate;
    // Days for the other party to withdraw the money
    uint256 public daysForWithdrawal;

    // Constructor to initialize the contract
    constructor(address payable _depositHolder, address payable _otherParty, uint256 _securityDeposit, uint256 _endDate, uint256 _daysForWithdrawal) {
        // Store the address of the deposit holder
        depositHolder = _depositHolder;
        // Store the address of the other party
        otherParty = _otherParty;
        // Store the security deposit amount
        securityDeposit = _securityDeposit;
        // Store the end date of the agreement
        endDate = _endDate;
        // Store the days for the other party to withdraw the money
        daysForWithdrawal = _daysForWithdrawal;
    }

    // Function for the deposit holder to release the security deposit
    function releaseDeposit() public {
        // Check if the sender is the deposit holder
        require(msg.sender == depositHolder, "Only the deposit holder can release the deposit.");
        // Check if the agreement has ended
        require(block.timestamp >= endDate, "Agreement has not ended yet.");
        // Check if the other party has not claimed the deposit within the specified number of days
        require(block.timestamp <= endDate + daysForWithdrawal * 1 days, "Other party has claimed the deposit within the specified number of days.");

        // Transfer the security deposit to the other party
        otherParty.transfer(securityDeposit);
    }
}

